import React from 'react'
import "./Profile.css"
import { useState } from 'react'
function Profile() {
  let[state,setState]=useState("data:image/jpeg;base64,");
  let[data,setData]=useState({
    name:"",
    gender:"",
    desig:"",
    desc:""

  })
  let[theme,setTheme]=useState({
    textcolor:"",
    bgcolor:"",
    title:""
  })
  const changeRajat=()=>{
 setState("data:image/jpeg;base64,");
  setData({
    name:"RAJAT RAY",
    gender:"MALE",
    desig:"MANAGER",
    desc:"HE IS A DYNAMIC LEADER"
  }) 
}
  const changeRiya=()=>{
    setState("data:image/jpeg;base64,");
     setData({
    name:"RIYA SHARMA",
    gender:"FEMALE",
    desig:"ANALYST",
    desc:"SHE HAS A  GOOD ANALYTICAL KNOWLEDGE"
  }) 
  }
  const changeTheme=(event)=>{
     if(event.target.checked)
     {
       setTheme({
        textcolor:'white',
        bgcolor:'black',
        title:'DARK MODE'
       })
     }
     else{
       setTheme({
        textcolor:'black',
        bgcolor:'white',
        title:'LIGHT MODE'
       })
     }
  }
  return (
    <div className='mainContainer'>
       
      <div className='leftContainer'>
     <img src={state}
     height="300px"
     width={300}
     alt="NO IMAGE"/>
      </div>
      <div className='rightContainer' style={{color:theme.textcolor,backgroundColor:theme.bgcolor}}>
       <h2>NAME:{data.name}</h2>
       <h2>GENDER:{data.gender}</h2>
       <h2>DESIGNATION:{data.desig}</h2>
       <h2>DESCRIPTION:{data.desc}</h2>
       <button onClick={changeRajat}>RAJAT</button> &nbsp;&nbsp;
       <button onClick={changeRiya}>RIYA</button>
       <input type="checkbox" onChange={changeTheme}/>
       <h2>TITLE:{theme.title}</h2>
      </div>
    </div>
  )
}

export default Profile
